import React from "react";
import "../styles/Register.css"; // Import external CSS file
import { useNavigate } from "react-router-dom";


const Register = () => {
    const navigate = useNavigate();
    const handleSigninRedirect = () => {
        navigate("/login"); 
      };
  return (
    <div className="register-container">
      {/* Left Column - Registration Form */}
      <div className="register-form">
        <h2>Create An Account</h2>
        <p>Your Personal Job Finder Is Here</p>
        
        <div className="form-group">
          <input type="text" placeholder="Name" />
        </div>
        
        <div className="form-group">
          <input type="email" placeholder="Email" />
        </div>
        
        <div className="form-group">
          <input type="tel" placeholder="Mobile" />
        </div>
        
        <div className="form-group">
          <input type="password" placeholder="Password" />
        </div>
        
        <div className="form-group checkbox-group">
          <input type="checkbox" id="terms" />
          <label htmlFor="terms">
            By creating an account, I agree to the <a href="#">terms of use</a> and <a href="#">privacy policy</a>
          </label>
        </div>
        
        <button className="create-account-btn">Create Account</button>
        
        <p className="signin-text" onClick={handleSigninRedirect}>
          Already have an account? <a href="#">Sign In</a>
        </p>
      </div>
      
      {/* Right Column - Image */}
      <div className="register-image">
        <img src="https://via.placeholder.com/400" alt="Register Visual" />
      </div>
    </div>
  );
};

export default Register;
